description:
The Plantagenets (BBC)

History Documentary hosted by Robert Bartlett, published by BBC in 2014 - English narration


Information
------------------------------
Professor Robert Bartlett tells the extraordinary story of England's most dysfunctional, yet longest ruling, royal dynasty and charts their rise and downfall.

2) An English Empire
England's longest-reigning royal dynasty fights to expand their power across the British Isles, and win back their lands in France. In this golden age of chivalry, a clear sense of English nationhood emerges and parliament is born.

